import React from 'react';

const ConfirmationPage = () => {
  return (
    <div className="confirmation-page bg-gray-100 min-h-screen flex flex-col justify-center items-center">
      <h1 className="text-4xl font-bold text-green-700 mb-4">Booking Confirmed!</h1>
      <p className="text-lg text-gray-700">Thank you for choosing eco-friendly travel. Have a great journey!</p>
    </div>
  );
};

export default ConfirmationPage;
